import {Injectable} from '@angular/core';
import {HttpClient} from '@angular/common/http/http';
import {Router} from '@angular/router';
import {Observable, BehaviorSubject, Subject} from 'rxjs';
import {RastersGroup} from './RastersGroup';
import {RasterEntity} from './RasterEntity';
declare var esri: any;

@Injectable({
  providedIn: 'root'
  , deps: [HttpClient, Router]
})
export class RastersService {

  private rasterGroups: BehaviorSubject<RastersGroup[]> = new BehaviorSubject<RastersGroup[]>([]);
  private rastersmap: Map<number, any> = new Map();
  private rasterImages: Map<number, any> = new Map();
  private rasterProperties: Map<number, any> = new Map();

  public constructor() {
    setTimeout(() => {
      this.loadRasters();
    }, 1000);
  }

  public getRasterEntity(rasterId: number): Subject<RasterEntity> {
    const s: BehaviorSubject<RasterEntity> = new BehaviorSubject(null);
    if (this.rastersmap.has(rasterId)) {
      s.next(this.rastersmap.get(rasterId));
    } else {
      this.loadRasterEntity(rasterId, (e: RasterEntity) => {
        s.next(e);
      })
    }
    return s;
  }

  public getEsriMapImage(rasterId: number): Observable<any> {
    const obs = new BehaviorSubject(null);
    setTimeout(() => {
      const imageURL = this.rasterImages.get(rasterId);
      const image = esri.layers.MapImage({
        'extent': {
          'xmin': -13525318,
          'ymin': 4439106,
          'xmax': -13358338,
          'ymax': 4565942,
          'spatialReference': {'wkid': 32610}
        },
        'href': imageURL
      });
      obs.next(image);
    });
    return obs;
  }

  /**
   * 
   */
  private loadRasterEntity(rasterId: number, callback: any): void {
    setTimeout(() => {
      const e = new RasterEntity(rasterId);
      this.rastersmap.set(rasterId, e);
      callback(e);
    }, 10);
  }

  private loadRasters(): void {
    setTimeout(() => {
      const arr: RastersGroup[] = [
        new RastersGroup(0, "Global Horizontal Irradiance", [0])
        , new RastersGroup(1, "NOAA", [1])
        , new RastersGroup(2, "METRIC-ET", [2])
        , new RastersGroup(3, "GOES-W", [3, 4])
      ];
      this.rasterImages.set(0, "data:image/png;base64,");
      this.rasterImages.set(1, "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAoAAAAJCAIAAACExCpEAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAAAASSURBVChTY5DutMGDRqZ0pw0A4ZNOwQNf");
      this.rasterImages.set(2, "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAUAAAAFCAYAAACNbyblAAAAHElEQVQI12P4//8/w38GIAXDIBKE0DHxgljNBAAO9TXL0Y4OHwAAAABJRU5ErkJggg==");
      this.rasterImages.set(3, "data:application/octet-stream;base64,");
      this.rasterImages.set(4, "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABkAAAAZCAYAAADE6YVjAAAAJUlEQVR42u3NQQEAAAQEsJNcdFLw2gqsMukcK4lEIpFIJBLJS7KG6yVo40DbTgAAAABJRU5ErkJggg==");
      this.rasterGroups.next(arr);
    });

  }

  /**
   * 
   */
  public getRasters(): Observable<RastersGroup[]> {
    return this.rasterGroups;
  }

}

